require 'rails_helper'

describe 'api/v1/pub/stories' do
  let!(:user) { FactoryGirl.create(:user) }
  let!(:doorkeeper_application) { FactoryGirl.create(:doorkeeper_application) }
  let!(:doorkeeper_access_token) do
    FactoryGirl.create(:doorkeeper_access_token, application: doorkeeper_application,
                                                 resource_owner_id: user.id)
  end
  let!(:hash_tag) { FactoryGirl.create(:hash_tag) }
  let!(:title) { 'some title' }
  let!(:description) { 'description' }
  let!(:image) { { base64_data: 'data:image/jpeg;base64,', original_filename: 'test.png' } }

  before do
    allow_any_instance_of(Paperclip::Attachment).to receive(:save).and_return(true)
  end

  describe 'POST api/v1/pub/stories' do
    it 'returns status 201 for successful create' do
      post '/api/v1/pub/stories', access_token: doorkeeper_access_token.token, title: title, description: description, image: image,
                                  hash_tag_ids: [hash_tag.id]

      expect(response.status).to eq 201
    end

    it 'retuns 422 with image error when image is blank' do
      post "/api/v1/pub/stories", access_token: doorkeeper_access_token.token, image: nil

      expect(JSON.parse(response.body)["errors"]).to eq "Image can't be blank"
    end

    it 'returns 422 for errors in saving' do
      post '/api/v1/pub/stories', access_token: doorkeeper_access_token.token, description: nil

      expect(response.status).to eq 422
    end
  end

  describe 'PUT api/v1/pub/stories/:id' do
    let!(:story) { FactoryGirl.create(:story, user: user) }

    it 'returns status 200 for successful update' do
      put "/api/v1/pub/stories/#{story.id}", access_token: doorkeeper_access_token.token, description: "Updated story.", title: "Updated title", image: image

      expect(response.status).to eq 200
    end

    it 'returns 422 for errors in updating' do
      put "/api/v1/pub/stories/#{story.id}", access_token: doorkeeper_access_token.token, description: nil,
      image: image

      expect(response.status).to eq 422
    end
  end

  describe 'GET api/v1/pub/stories/:id' do
    let!(:story) { FactoryGirl.create(:story, user: user) }

    it 'returns status 200 for successful response' do
      get "/api/v1/pub/stories/#{story.id}", access_token: doorkeeper_access_token.token

      expect(response.status).to eq 200
    end

    it 'returns status 404 when there is no story with given id' do
      story.destroy

      get "/api/v1/pub/stories/#{story.id}", access_token: doorkeeper_access_token.token

      expect(response.status).to eq 404
    end

    it 'returns story fields in response' do
      story = FactoryGirl.create(:story, user: user)
      story.liked_by user

      comment = FactoryGirl.create(:comment, user: user, content: story)

      hash_tag = FactoryGirl.create(:hash_tag)
      FactoryGirl.create(:contents_hash_tag, content: story, hash_tag: hash_tag)

      get "/api/v1/pub/stories/#{story.id}", access_token: doorkeeper_access_token.token

      expect(json['id']).to eq story.id
      expect(json['title']).to eq story.title
      expect(json['description']).to eq story.description
      expect(json['image_url']).to eq story.image.url
      expect(json['number_of_likes']).to eq 1
      expect(json['created_at']).to eq story.created_at.to_i
      expect(json['updated_at']).to eq story.updated_at.to_i

      expect(json['hash_tags'].first['name']).to eq hash_tag.name

      expect(json['user']['id']).to eq story.user.id
      expect(json['user']['full_name']).to eq story.user.full_name
      expect(json['user']['avatar_url']).to eq story.user.avatar.url

      expect(json['comments'].first['id']).to eq comment.id
      expect(json['comments'].first['body']).to eq comment.body
      expect(json['comments'].first['created_at']).to eq comment.created_at.to_i
      expect(json['comments'].first['updated_at']).to eq comment.updated_at.to_i

      expect(json['comments'].first['user']['id']).to eq comment.user.id
      expect(json['comments'].first['user']['full_name']).to eq comment.user.full_name
      expect(json['comments'].first['user']['avatar_url']).to eq comment.user.avatar.url
    end
  end
end
